import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import ReactPlayer from "react-player";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";

class CardA extends Component {
  GoToCardA() {
    this.props.history.push("/About");
  }

  handleClick(e) {
    this.GoToCardA("element clicked");
  }

  render() {
    return (
      <Grid item xs={6} sm={3} md={3}>
        <div className="section">
          <Card>
            <CardActionArea onClick={this.handleClick.bind(this)}>
              <CardMedia
                className="card"
                image={require("./color4.png")}
                title="Contemplative Art"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  Project 1
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                  The Shiba Inu is a Japanese breed of hunting dog. A small,
                  agile dog that copes very well with mountainous terrain, the
                  Shiba Inu was originally bred for hunting.
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </div>
      </Grid>
    );
  }
}

export default CardA;
